        public static void AddToInstructionSet(InstructionPrefix prefix, byte opcode, string mnemonic, ArgumentType argument1, ArgumentType argument2, ModifierType modifier, byte size, byte clockCycles, byte? clockCyclesConditional, IMicrocode implementation)
        {
            Instruction instruction = new Instruction(prefix, opcode, mnemonic, argument1, argument2, modifier, size, clockCycles, clockCyclesConditional, implementation);
            InstructionSet.Instructions[prefix].Add(opcode, instruction);
        }
